    B_field = temp(1,1);
    x = temp(:,2);
    y = temp(:,3);
    
    % linear interpolation
    mdl = fitlm(x, y);
    t = linspace(min(x), max(x), 100);
    A = mdl.Coefficients.Estimate(1);
    B = mdl.Coefficients.Estimate(2);
    disp(sprintf("%d %f %f\n", i, A, B));
    
    
    
    scatter(x, y);
    plot(t, A + B*t, 'LineWidth', 1, 'LineStyle','-');
    
    %title(sprintf("B: %.1f [mT]", B_field*1000), 'FontSize', 15, 'FontWeight', 'bold');
    title("Trial 3", 'FontSize', 15, 'FontWeight', 'bold');
    xlabel("$I$ [A]", 'Interpreter', 'latex', 'FontSize', 15, 'FontWeight', 'bold');
    ylabel("$V_2 - V_1$ [V]", 'Interpreter', 'latex', 'FontSize', 15, 'FontWeight', 'bold');
    

end
